pragma solidity ^0.5.16;


contract PagareTracker {
    string id;

    function setId(string memory serial) public {
        id = serial;
    }

    function getId() public view returns (string memory) {
        return id;
    }

    //Info tiene las variables: fecha_creacion,fecha_vencimiento,fecha_expiracion,lugar_creacion,lugar_cumplimiento
    struct Pagare {
        string _id;
        string valor;
        string id_deudor;
        string id_acredor;
        string info;
        string firma;
        bool initialized;
    }

    mapping(string => Pagare) private pagareStore;

    //[id_acreedor][id_pagare]
    mapping(string => mapping(string => bool)) private acreedorStore;

    //[id_deudor][id_pagare]
    mapping(string => mapping(string => bool)) private deudorStore;

    event PagareCreate(
        string _id,
        string deudor_id,
        string acreedor_id,
        string valor
    );
    event RejectCreate(string _id, string message);
    event PagareEndoso(string from, string to, string _id);
    event RejectEndoso(string from, string to, string _id, string message);

    function createPagare(
        string memory _id,
        string memory valor,
        string memory id_deudor,
        string memory id_acredor,
        string memory info,
        string memory firma
    ) public {
        pagareStore[id] = Pagare(
            _id,
            valor,
            id_deudor,
            id_acredor,
            info,
            firma,
            true
        );
        acreedorStore[id_acredor][_id] = true;
        deudorStore[id_deudor][_id] = true;
        emit PagareCreate(_id, id_deudor, id_acredor, valor);
    }

    function transferPagare(
        string memory id_endosante,
        string memory id_endosatario,
        string memory _id
    ) public {
        if (!pagareStore[_id].initialized) {
            emit RejectEndoso(
                id_endosante,
                id_endosatario,
                _id,
                "No existe el pagare con el id"
            );
            return;
        }

        if (!acreedorStore[id_endosante][_id]) {
            emit RejectEndoso(
                id_endosante,
                id_endosatario,
                _id,
                "El endosante no tiene el pagare con el id"
            );
            return;
        }

        acreedorStore[id_endosante][_id] = false;
        acreedorStore[id_endosatario][_id] = true;
        emit PagareEndoso(id_endosante, id_endosatario, _id);
    }

    function getPagareById(string memory _id)
        public
        view
        returns (string memory, string memory, string memory, string memory, string memory, string memory)
    {
        Pagare storage p = pagareStore[_id];
        // string _id, string valor, string id_deudor, string id_acredor, string info, string firma
        return (p._id, p.valor, p.id_deudor, p.id_acredor, p.info, p.firma);
    }

    function isOwnerOf(string memory owner, string memory _id)
        public
        view
        returns (bool)
    {
        if (acreedorStore[owner][_id]) {
            return true;
        }

        return false;
    }
}
